  // const [films, setFilms] = useState([])
  // const [filmId, setFilmId] = useState()
  const [film, setFilm] = useState('no film')

    return (
      <>
         <BrowserRouter>
              <Routes>
                  <Route path="/" element={<LandingPage film={film} setFilm={setFilm} />} />
                  <Route path="/Fellowship" element={<Fellowship />} />
              </Routes>
        </BrowserRouter>
      </>
    )
}

export default App;
